import React, { useState } from 'react';
import { Grid, TextField, Button } from "@material-ui/core";
import { Container, Typography, Paper } from "@material-ui/core";
import Parkingslots from './Parkingslots';
const Bookingform = () => {
  const [formData, setFormData] = useState({
    vehicle_number:"",
    entry_time:"",
    exit_time:"",
    number_slot:0
  });

  const [slotData ,setSlotData] = useState([])

  const handleFormInput = (e) =>{
    const {name,value} = e.target
    console.log(name,value)
    formData[name] = value
    console.log(formData,"inside function form data")
    setFormData(formData)
  }



  const handleFormSubmmit =()=>{
    slotData.push(formData)
    console.log(formData,"handleFormSubmmit",slotData)
    setSlotData(slotData)
  }
  // const getVehiclenumber = (e) => {
  //   console.log(e.target.value);
  // };

  // const bookedSlot = (e) => {
  //   console.log(e.target.value);
  // };

  // const EntryTime = (e) => {
  //   console.log(e.target.value);
  // };
  // const ExittTme = (e) => {
  //   console.log(e.target.value);
  // };
  return (
    <Container style={{ padding: 16, margin: "auto", maxWidth: 800 }}>
      <Typography
        variant="h4"
        align="center"
        component="h1"
        style={{ padding: 16 }}
      >
        Parking Lot Management System !
      </Typography>
      <Grid>
        <Paper style={{ padding: 16 }}>
          <Grid container justify="flex-start" alignItems="center" spacing={2}>
            <Grid item xs={12}>
              <TextField
                label="Vehicle Number"
                color="secondary"
                variant="outlined"
                type="Text"
                name="vehicle_number"
                fullWidth
                onChange={handleFormInput}
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                label="Entry Time"
                color="secondary"
                variant="outlined"
                fullWidth
                type="time"
                name="entry_time"
                defaultValue="00:00:00"
                onChange={handleFormInput}
              />
            </Grid>

            <Grid item xs={12} mt={4}>
              <TextField
                label="Exit Time"
                color="secondary"
                variant="outlined"
                fullWidth
                type="time"
                name="exit_time"
                defaultValue="00:00:00"
                onChange={handleFormInput}
              />
            </Grid>

            <Grid item xs={12}>
              <TextField
                label="NumberOfSlot"
                color="secondary"
                variant="outlined"
                type="number"
                name="number_slot"
                fullWidth
                onChange={handleFormInput}
              />
            </Grid>

            <Grid
              container
              justify="space-evenly"
              alignItems="center"
              style={{ padding: 16 }}
            >
              <Button variant="contained" color="primary" type="submit" onClick={handleFormSubmmit}>
                Submit
              </Button>
              <Button variant="contained" color="secondary" type="button">
                Reset
              </Button>
            </Grid>
          </Grid>
        </Paper>
      </Grid>
      <Parkingslots bookingData = {slotData}/> 
    </Container>
  );
};

export default Bookingform;
